using System;
using System.Collections.Generic;
using Meta.Net.Sync.Types;
using Meta.Net.Types;
using Meta.Net.Objects;

namespace Meta.Net.Sync.Converters
{
    public static class DataCollations
    {
		private static HashSet<string> MySqlCollations { get; set; }
        private static Dictionary<string, string> MySqlToSqlServerLookup { get; set; }
        private static HashSet<string> SqlServerCollations { get; set; }
        private static Dictionary<string, string> SqlServerToMySqlLookup { get; set; }
        
        /// <summary>
        /// Static Constructor for DataCollations.
        /// Initializes LookupTables and prepares class for general use.
        /// </summary>
        static DataCollations()
        {
            MySqlCollations = new HashSet<string>(StringComparer.OrdinalIgnoreCase);
            SqlServerCollations = new HashSet<string>(StringComparer.OrdinalIgnoreCase);
            MySqlToSqlServerLookup = new Dictionary<string, string>(StringComparer.OrdinalIgnoreCase);
            SqlServerToMySqlLookup = new Dictionary<string, string>(StringComparer.OrdinalIgnoreCase);
            MySqlCollations.UnionWith(System.Enum.GetNames(typeof(MySqlCollationType)));
            SqlServerCollations.UnionWith(System.Enum.GetNames(typeof(SqlServerCollationType)));
            BuildMySqlToSqlServerLookup();
            BuildSqlServerToMySqlLookup();
        }

		/// <summary>
        /// Compares the Collation between source and target user-table columns and even
        /// matches against differing data contexts.
        /// </summary>
        /// <param name="sourceDataContext">The source DataContext.</param>
        /// <param name="targetDataContext">The target DataContext.</param>
        /// <param name="sourceUserTableColumn">The source user-table column to get a collation from.</param>
        /// <param name="targetUserTableColumn">The target user-table column to get a collation from.</param>
        /// <returns>
        ///     True - The collations matched between differing datasources.
        ///     False - The collations could not be matched up.
        /// </returns>
        public static bool CompareCollation(DataContext sourceDataContext, DataContext targetDataContext, UserTableColumn sourceUserTableColumn, UserTableColumn targetUserTableColumn)
        {
            if (string.IsNullOrEmpty(sourceUserTableColumn.Collation) && string.IsNullOrEmpty(targetUserTableColumn.Collation))
                return true;

            if (string.IsNullOrEmpty(sourceUserTableColumn.Collation))
                return false;

            if (string.IsNullOrEmpty(targetUserTableColumn.Collation))
                return false;

            if (sourceDataContext.ContextType == targetDataContext.ContextType)
                if (StringComparer.OrdinalIgnoreCase.Compare(
                    sourceUserTableColumn.Collation, targetUserTableColumn.Collation) != 0)
                    return false;

            switch (sourceDataContext.ContextType)
            {
                case DataContextType.MySql:
                    if (!MySqlCollations.Contains(sourceUserTableColumn.Collation))
                        return true;

                    switch (targetDataContext.ContextType)
                    {
                        case DataContextType.SqlServer:
                            string collation;
                            return !MySqlToSqlServerLookup.TryGetValue(sourceUserTableColumn.Collation, out collation)
                                || StringComparer.OrdinalIgnoreCase.Compare(collation, targetUserTableColumn.Collation) == 0;
                        default:
                            return true;
                    }
                case DataContextType.SqlServer:
                    if (!SqlServerCollations.Contains(sourceUserTableColumn.Collation))
                        return true;

                    switch (targetDataContext.ContextType)
                    {
                        case DataContextType.MySql:
                            string collation;
                            return !SqlServerToMySqlLookup.TryGetValue(sourceUserTableColumn.Collation, out collation)
                                || StringComparer.OrdinalIgnoreCase.Compare(collation, targetUserTableColumn.Collation) == 0;
                        default:
                            return true;
                    }
                default:
                    return true;
            }
        }

        /// <summary>
        /// Matches Collation against differing data contexts and returns a string containing
        /// the collation for the target data context or string.Empty if it was not found.
        /// </summary>
        /// <param name="sourceDataContext">The source DataContext.</param>
        /// <param name="targetDataContext">The target Datacontext.</param>
        /// <param name="userTableColumn">The user-table column to pull Collation from.</param>
        /// <returns>
        ///     The target Collation to use for the given user-table column or string.Empty if one was not found.
        /// </returns>
        public static string ConvertCollation(DataContext sourceDataContext, DataContext targetDataContext, UserTableColumn userTableColumn)
        {
            if (string.IsNullOrEmpty(userTableColumn.Collation))
                return string.Empty;

            if (sourceDataContext.ContextType == targetDataContext.ContextType)
                return userTableColumn.Collation;

            switch (sourceDataContext.ContextType)
            {
                case DataContextType.MySql:
                    if (!MySqlCollations.Contains(userTableColumn.Collation))
                        return string.Empty;

                    switch (targetDataContext.ContextType)
                    {
                        case DataContextType.SqlServer:
                            string collation;
                            return !MySqlToSqlServerLookup.TryGetValue(userTableColumn.Collation, out collation)
                                ? string.Empty
                                : collation;
                        default:
                            return string.Empty;
                    }
                case DataContextType.SqlServer:
                    if (!SqlServerCollations.Contains(userTableColumn.Collation))
                        return string.Empty;

                    switch (targetDataContext.ContextType)
                    {
                        case DataContextType.MySql:
                            string collation;
                            return !SqlServerToMySqlLookup.TryGetValue(userTableColumn.Collation, out collation)
                                ? string.Empty
                                : collation;
                        default:
                            return string.Empty;
                    }
                default:
                    return string.Empty;
            }
        }

		/// <summary>
        /// Initializes MySqlToSqlServerLookup
        /// </summary>
        private static void BuildMySqlToSqlServerLookup()
        {
            // Add ucs2 for greatest compatibility
            // ucs2, UCS-2 Unicode, ucs2_general_ci, 2

            // http://imysql.cn/docs/MySQL_51_en/ch10s09.html
            // West European Languages - French, Spanish, Catalan, Basque, Portuguese, Italian, Albanian, Dutch, German, Danish, Swedish, Norwegian, Finnish, Faroese, Icelandic, Irish, Scottish, English
            // cp850 - DOS West European
            // dec8 - DEC Western European
            // hp8 - HP Western European
            // macroman - Mac West European
            // swe7 - 7bit Swedish
            // latin1 - cp1252 West European - ISO 8859-1 or IANA (Internet Assigned Numbers Authority)
            // MySQL translates 0x81 to Unicode 0x0081, 0x8d to 0x008d, 0x8f to 0x008f, 0x90 to 0x0090, and 0x9d to 0x009d.
            // The latin1_german1_ci and latin1_german2_ci collations are based on the DIN-1 and DIN-2 standards,
            // where DIN stands for Deutsches Institut for Normung (the German equivalent of ANSI). DIN-1 is called the
            // dictionary collation and DIN-2 is called the phone book collation.

            // cp852 - DOS Central European
            // keybcs2 - DOS Kamenicky Czech-Slovak
            // latin2 - ISO 8859-2 Central European

            // Central European Languages - Czech Republic, Slovakia, Hungary, Romania, Slovenia, Croatia, Poland
            // cp1250 - Windows Central European
            // cp852 - DOS Central European
            // keybcs2 - DOS Kamenicky Czech-Slovak
            // latin2 - ISO 8859-2 Central European
            // macce - Mac Central European

            // South European and Middle East Languages - Armenian, Arabic, Georgian, Greek, Hebrew, Turkish
            // armscii8 - ARMSCII-8 Armenian
            // cp1256 - Windows Arabic
            // geostd8 - GEOSTD8 Georgian
            // greek - ISO 8859-7 Greek
            // hebrew - ISO 8859-8 Hebrew
            // latin5 - ISO 8859-9 Turkish

            // Baltic Languages - Estonian, Latvian, Lithuanian
            // cp1257 - Windows Baltic
            // latin7 - ISO 8859-13 Baltic

            // Cyrillic Languages - Belarusian, Bulgarian, Russian, Ukrainian
            // cp1251 - Windows Cyrillic
            // cp866 - DOS Russian
            // koi8r - KOI8-R Relcom Russian
            // koi8u - KOI8-U Ukrainian

            // Asian Languages - Chinese, Japanese, Korean, Thai
            // big5 - Big5 Traditional Chinese
            // cp932 - SJIS for Windows Japanese
            // eucjpms - UJIS for Windows Japanese
            // euckr - EUC-KR Korean
            // gb2312 - GB2312 Simplified Chinese
            // gbk - GBK Simplified Chinese
            // sjis - Shift-JIS Japanese
            // tis620 - TIS620 Thai
            // ujis - EUC-JP Japanese
            // the sjis character set corresponds to the Shift_JIS character set defined by IANA,
            // which supports JIS X0201 and JIS X0208 characters. SHIFT JIS used in Japanese Windows environments
            // is a Microsoft extension of Shift_JIS and its exact name is Microsoft Windows Codepage : 932 or cp932.
            // In addition to the characters supported by Shift_JIS, cp932 supports extension characters such as NEC
            // special characters, NEC selected IBM extended characters, and IBM extended characters.
            // Because MySQL supports character set conversion, it is important to separate IANA Shift_JIS and cp932
            // into two different character sets because they provide different conversion rules.
            // cp932 supports conversion of user-defined characters in combination with eucjpms, and solves the
            // problems with sjis/ujis conversion.

            // armscii8, ARMSCII-8 Armenian, armscii8_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.armscii8_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.armscii8_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1256_CI_AS));

            // ascii, US ASCII, ascii_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.ascii_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.ascii_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_CI_AS));

            // big5, Big5 Traditional Chinese, big5_chinese_ci, 2
            // Chinese-Taiwan-Stroke, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.big5_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Chinese_Taiwan_Stroke_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.big5_chinese_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Chinese_Taiwan_Stroke_CI_AS));

            // binary, Binary pseudo charset, binary, 1
            // Latin1-General, binary sort
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.binary),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));

            // cp1250, Windows Central European, cp1250_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 82 on Code Page 1250 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1250_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1250_croatian_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Croatian_CP1250_CI_AS));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1250_czech_cs),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Czech_CP1250_CI_AS));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1250_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1250_CI_AS));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1250_polish_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Polish_CP1250_CI_AS));
            
            // cp1251, Windows Cyrillic, cp1251_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 106 on Code Page 1251 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1251_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1251_bulgarian_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1251_CI_AS));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1251_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1251_CI_AS));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1251_general_cs),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1251_CS_AS));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1251_ukrainian_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Ukrainian_CP1251_CI_AS));

            // cp1256, Windows Arabic, cp1256_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 146 on Code Page 1256 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1256_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1256_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1256_CI_AS));

            // cp1257, Windows Baltic, cp1257_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 154 on Code Page 1257 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1257_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp1257_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1257_CI_AS));

            // cp850, DOS West European, cp850_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 42 on Code Page 850 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp850_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP850_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp850_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP850_CI_AS));

            // cp852, DOS Central European, cp852_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 52 on Code Page 1252 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp852_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp852_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1_CI_AS));

            // cp866, DOS Russian, cp866_general_ci, 1
            // Cyrillic-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp866_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Cyrillic_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp866_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Cyrillic_General_CI_AI));

            // cp932, SJIS for Windows Japanese, cp932_japanese_ci, 2
            // Japanese-Unicode, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp932_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Japanese_Unicode_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.cp932_japanese_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Japanese_Unicode_CI_AS));

            // dec8, DEC West European, dec8_swedish_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 52 on Code Page 1252 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.dec8_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.dec8_swedish_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1_CI_AS));

            // eucjpms, UJIS for Windows Japanese, eucjpms_japanese_ci, 3
            // Japanese-Unicode, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.eucjpms_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Japanese_Unicode_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.eucjpms_japanese_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Japanese_Unicode_CI_AS));

            // euckr, EUC-KR Korean, euckr_korean_ci, 2
            // Korean-Wansung, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.euckr_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Korean_Wansung_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.euckr_korean_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Korean_Wansung_CI_AS));

            // gb2312, GB2312 Simplified Chinese, gb2312_chinese_ci, 2
            // Chinese-Taiwan-Stroke, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.gb2312_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Chinese_Taiwan_Stroke_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.gb2312_chinese_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Chinese_Taiwan_Stroke_CI_AS));

            // gbk, GBK Simplified Chinese, gbk_chinese_ci, 2
            // Chinese-Taiwan-Stroke, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.gbk_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Chinese_Taiwan_Stroke_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.gbk_chinese_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Chinese_Taiwan_Stroke_CI_AS));

            // geostd8, GEOSTD8 Georgian, geostd8_general_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 52 on Code Page 1252 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.geostd8_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.geostd8_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1_CI_AS));

            // greek, ISO 8859-7 Greek, greek_general_ci, 1
            // Greek, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.greek_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Greek_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.greek_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Greek_CI_AS));

            // hebrew, ISO 8859-8 Hebrew, hebrew_general_ci, 1
            // Hebrew, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.hebrew_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Hebrew_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.hebrew_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Hebrew_CI_AS));

            // hp8, HP West European, hp8_english_ci, 1
            // Latin1-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive for Unicode Data,
            // SQL Server Sort Order 52 on Code Page 1252 for non-Unicode Data
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.hp8_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Latin1_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.hp8_english_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.SQL_Latin1_General_CP1_CI_AS));

            // keybcs2, DOS Kamenicky Czech-Slovak, keybcs2_general_ci, 1
            // Czech, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.keybcs2_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Czech_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.keybcs2_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Czech_CI_AS));

            // koi8r, KOI8-R Relcom Russian, koi8r_general_ci, 1
            // Cyrillic-General, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.koi8r_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Cyrillic_General_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.koi8r_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Cyrillic_General_CI_AI));

            // koi8u, KOI8-U Ukrainian, koi8u_general_ci, 1
            // Ukrainian, case-insensitive, accent-sensitive, kanatype-insensitive, width-insensitive
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.koi8u_bin),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Ukrainian_BIN));
            MySqlToSqlServerLookup.Add(System.Enum.GetName(typeof(MySqlCollationType), MySqlCollationType.koi8u_general_ci),
                System.Enum.GetName(typeof(SqlServerCollationType), SqlServerCollationType.Ukrainian_CI_AS));

            // latin1, cp1252 West European, latin1_swedish_ci, 1
